When a group of hikers heads into the mountains of Virginia for some weekend R &amp; R, their pleasant trek goes off the rails when they run into the Stauntons, a deranged family who will do anything to get the interlopers off their land. Now the friends are in a desperate fight for their lives in the isolated backcountry. Cameron Romero directs this horror film that stars Kathy Lamkin, David Rountree, Kiko Ellsworth and Cooper Huckabee.

Starring: Kathy Lamkin, Cristen Coppen

Director: Cameron Romero

